      padding: '30px 20px',
    }
}));

function Bridge() {
    const classes = useStyles();
    return (
        <div className={classes.root}>
            <form action="">
                <label htmlFor="">Ori</label>
                <input type="text"/>
                <label htmlFor="">Bene</label>
                <input type="text"/>
                <label htmlFor="">Result</label>
                <input type="text"/>
            </form>
        </div>
    );
}

export default Bridge;
